import React from 'react';

function Contact() {
  return (
    <div className="contact" style={{ color: 'white' }}>
      <h1>Contact Us</h1>
      <h3>If you have any questions, feel free to contact us using the information below.</h3>
      <h3>Phone: +1-800-123-4567</h3>
      <h3>Last updated on 07-10-2024 22:28:21</h3>
      <h3>You may contact us using the information below:</h3>
      <h3>Merchant Legal entity name: HRITIK SAGAR SRIVASTAVA </h3>
      <h3>Registered Address: 1166/23/47/122C kidwai Nagar Allahpur, Prayagraj, Uttar Pradesh, PIN: 211006</h3>
      <h3> Operational Address: 1166/23/47/122C kidwai Nagar Allahpur, Prayagraj, Uttar Pradesh, PIN: 211006</h3>
      <h3>Telephone No: 9453930121</h3>
     <h3>Email: <a href="hritik.srivastava28@gmail.com">lol.shruti@pllatinum.tech</a></h3>
    </div>
  );
}

export default Contact;
